			defaultPhotos.push(images[i]);
		}
	});

	const cards = [];

	pets.map((pet, i) => {
		cards.push(<Card key={pets[i].id} img={'http://localhost:4412/api/file/' + images[j].url} name={pets[i].name} description={pets[i].description}/>);
	});

	return (
		<div>
